DROP TABLE IF EXISTS `Downloads`;
CREATE TABLE `Downloads` (`id` INTEGER AUTO_INCREMENT, `target` VARCHAR(255) NOT NULL, `ip` VARCHAR(255) NOT NULL, `origin` VARCHAR(255) NOT NULL, `time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, PRIMARY KEY(id));
DROP TABLE IF EXISTS `Logs`;
CREATE TABLE `Logs` (`id` INTEGER AUTO_INCREMENT, `baseUrl` VARCHAR(255) NOT NULL, `method` VARCHAR(255) NOT NULL, `originalUrl` VARCHAR(255) NOT NULL, `query` VARCHAR(255) NOT NULL, `params` VARCHAR(255) NOT NULL, `ip` VARCHAR(255) NOT NULL, `tag` VARCHAR(255) NOT NULL, `origin` VARCHAR(255) NOT NULL, `time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, PRIMARY KEY(id));
DROP TABLE IF EXISTS `Actions`;
CREATE TABLE `Actions` (`id` INTEGER AUTO_INCREMENT, `ip` VARCHAR(255) NOT NULL, `tag` VARCHAR(255) NOT NULL, `origin` VARCHAR(255) NOT NULL, `time` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, PRIMARY KEY(id));
